function Leaderboard_screen_js() {

    /* Object & array with components "name-to-id" mapping */
    var n2id_buf = {
        'CustomComponent1_3': 'Leaderboard_screen_CustomComponent1_3',
        'CustomComponent1_3_mobilenavbar_36': 'Leaderboard_screen_CustomComponent1_3_mobilenavbar_36',
        'CustomComponent1_3_mobilenavbaritem_37': 'Leaderboard_screen_CustomComponent1_3_mobilenavbaritem_37',
        'CustomComponent1_3_mobilenavbaritem_38': 'Leaderboard_screen_CustomComponent1_3_mobilenavbaritem_38',
        'mobilecollapsibleset_20': 'Leaderboard_screen_mobilecollapsibleset_20',
        'mobilecollapsblock_21': 'Leaderboard_screen_mobilecollapsblock_21',
        'mobilecollapsblockheader_22': 'Leaderboard_screen_mobilecollapsblockheader_22',
        'mobilecollapsblockcontent_23': 'Leaderboard_screen_mobilecollapsblockcontent_23',
        'mobilecollapsblock_24': 'Leaderboard_screen_mobilecollapsblock_24',
        'mobilecollapsblockheader_25': 'Leaderboard_screen_mobilecollapsblockheader_25',
        'mobilecollapsblockcontent_26': 'Leaderboard_screen_mobilecollapsblockcontent_26',
        'mobilecollapsblock_27': 'Leaderboard_screen_mobilecollapsblock_27',
        'mobilecollapsblockheader_28': 'Leaderboard_screen_mobilecollapsblockheader_28',
        'mobilecollapsblockcontent_29': 'Leaderboard_screen_mobilecollapsblockcontent_29'
    };

    if ("n2id" in window && window.n2id !== undefined) {
        $.extend(n2id, n2id_buf);
    } else {
        window.n2id = n2id_buf;
    }

    /*
     * Nonvisual components
     */

    Apperyio.mappings = Apperyio.mappings || {};

    Apperyio.datasources = Apperyio.datasources || {};

    Apperyio.CurrentScreen = 'Leaderboard_screen';
    _.chain(Apperyio.mappings).filter(function(m) {
        return m.homeScreen === Apperyio.CurrentScreen;
    }).each(Apperyio.UIHandler.hideTemplateComponents);

    /*
     * Events and handlers
     */

    // On Load
    var Leaderboard_screen_onLoad = function() {
            Leaderboard_screen_elementsExtraJS();

            Leaderboard_screen_deviceEvents();
            Leaderboard_screen_windowEvents();
            Leaderboard_screen_elementsEvents();
        };

    // screen window events


    function Leaderboard_screen_windowEvents() {

        $('#Leaderboard_screen').bind('pageshow orientationchange', function() {
            var _page = this;
            adjustContentHeightWithPadding(_page);
        });

    };

    // device events


    function Leaderboard_screen_deviceEvents() {
        document.addEventListener("deviceready", function() {

        });
    };

    // screen elements extra js


    function Leaderboard_screen_elementsExtraJS() {
        // screen (Leaderboard_screen) extra code

        /* mobilecollapsblock_21 */

        $("#Leaderboard_screen_mobilecollapsblock_21 .ui-collapsible-heading-toggle").attr("tabindex", "4");

        /* mobilecollapsblock_24 */

        $("#Leaderboard_screen_mobilecollapsblock_24 .ui-collapsible-heading-toggle").attr("tabindex", "4");

        /* mobilecollapsblock_27 */

        $("#Leaderboard_screen_mobilecollapsblock_27 .ui-collapsible-heading-toggle").attr("tabindex", "4");

    };

    // screen elements handler


    function Leaderboard_screen_elementsEvents() {
        $(document).on("click", "a :input,a a,a fieldset label", function(event) {
            event.stopPropagation();
        });

        $(document).off("click", '#Leaderboard_screen_mobilefooter [name="CustomComponent1_3_mobilenavbaritem_37"]').on({
            click: function(event) {
                if (!$(this).attr('disabled')) {
                    Apperyio.navigateTo('PRO_Notifications', {
                        transition: 'flip',
                        reverse: false
                    });

                }
            },
        }, '#Leaderboard_screen_mobilefooter [name="CustomComponent1_3_mobilenavbaritem_37"]');
        $(document).off("click", '#Leaderboard_screen_mobilefooter [name="CustomComponent1_3_mobilenavbaritem_38"]').on({
            click: function(event) {
                if (!$(this).attr('disabled')) {
                    Apperyio.navigateTo('Leaderboard_screen', {
                        transition: 'flip',
                        reverse: false
                    });

                }
            },
        }, '#Leaderboard_screen_mobilefooter [name="CustomComponent1_3_mobilenavbaritem_38"]');

    };

    $(document).off("pagebeforeshow", "#Leaderboard_screen").on("pagebeforeshow", "#Leaderboard_screen", function(event, ui) {
        Apperyio.CurrentScreen = "Leaderboard_screen";
        _.chain(Apperyio.mappings).filter(function(m) {
            return m.homeScreen === Apperyio.CurrentScreen;
        }).each(Apperyio.UIHandler.hideTemplateComponents);
    });

    Leaderboard_screen_onLoad();
};

$(document).off("pagecreate", "#Leaderboard_screen").on("pagecreate", "#Leaderboard_screen", function(event, ui) {
    Apperyio.processSelectMenu($(this));
    Leaderboard_screen_js();
});